#!/usr/bin/env python

keypad = [
    [None, None, '1', None, None],
    [None, '2', '3', '4', None],
    ['5', '6', '7', '8', '9'],
    [None, 'A', 'B', 'C', None],
    [None, None, 'D', None, None]
]


def up(x, y):
    if y == 0 or keypad[x][y - 1] is None:
        return x,y
    return (x, y - 1)


def down(x, y):
    if y == len(keypad)-1 or keypad[x][y + 1] is None:
        return x,y
    return (x, y + 1)


def left(x, y):
    if x == 0 or keypad[y][x - 1] is None:
        return x,y
    return (x - 1, y)


def right(x, y):
    if x == len(keypad[y])-1 or keypad[y][x + 1] is None:
        return x,y
    return (x + 1, y)

input = ["",
         "",
         "",
         "",
         "", ]

x = 0
y = 2
code = ""
for line in input:
    for i in line:
        if i == 'R':
            x, y = right(x, y)
        elif i == 'L':
            x, y = left(x, y)
        elif i == 'U':
            x, y = up(x, y)
        elif i == 'D':
            x, y = down(x, y)
    code += keypad[y][x]
print(code)
